import React from "react";
//import from "../assets/multiplePizzas.jpeg";
import "../styles/About.css";

function About() {
  return (
    <div className="about">
      <div
        className="aboutTop"
        //style={{ backgroundImage: `url(${MultiplePizzas})` }}
      >
         <h1> Over Ons </h1>
         <h3> Raymond Lahaije </h3>
      </div>
      <div className="aboutBottom">
<h3> Raymond Lahaije is mijn naam en ik ben gecertificeerd kynologisch instructeur, kynologisch gedragsdeskundige en gecertificeerde Pijn- en voedingscoach voor Honden bij Priority Dogs.
  </h3>
<h3>In mijn beleving word je met een hart voor honden (dieren in het algemeen) geboren. Bij de een gaat dat iets verder dan bij de ander. Bij mij misschien wel iets te ver soms.
  </h3>
<h3>Als kind groeide ik op met diverse honden en nu realiseer ik me dat er toen nog heel anders tegen honden werd aangekeken. Inmiddels zijn we in de hondenwereld een stuk wijzer ! Hopelijk zijn mensen zich ervan bewust dat je niet bij iedereen terecht kunt voor hulp met de hondenopvoeding. Om hierin zo veelzijdig mogelijk te zijn heb ik diverse opleidingen gevolgd in België en Nederland, zowel op medisch- als op gedragsdeskundig gebied. Het vergt de nodige jaren aan studie en ervaring en toch ben ik nog lang niet uitgeleerd.
  </h3>
<h3>Sinds enkele jaren word ik ingeschakeld door diverse dierenartspraktijken wanneer er probleemgedrag gemeld wordt. Soms zijn mensen de wanhoop nabij en is hulp op maat een vereiste. U zult vast begrijpen dat kennis en ervaring uit een boekje tekort schieten.
Mijn vrouw en ik hebben momenteel 1 Newfoundlander, Meadow, en 2 Västgötaspetsen (Zweedse Herders) Frida en Björna. We hebben een hele tijd vakantie opvang voor honden gedaan waardoor er inmiddels zo’n 90 honden ons huis van binnen gezien hebben (en zeker de helft hiervan heeft op de bank gelegen).
In het verleden was ik werkzaam als vrijwilliger bij een Kynologen club.
Gezien ik iets meer wilde dan de methode aldaar, ben ik in 2016 een eigen hondenopleidingscentrum begonnen. Wat ik eigenlijk niet gepland had is in no time tempo werkelijkheid geworden……………Priority Dogs!
</h3>
<p>AND I LOVE IT !</p>
      </div>
      </div>
  );
}

export default About;
